import "./App.css";
import { useState } from "react";

import Items from "./Items";

const App = () => {
  const [items, setItems] = useState([
    { name: "Milk" },
    { name: "Yogurt" },
    { name: "choc" },
  ]);

  return (
    <div
      className="Cart"
      style={{
        width: 500,
        height: 500,
        color: "blue",
        border: "solid 2px",
      }}
    >
      <Items items={items} setItems={setItems} />
    </div>
  );
};

export default App;
